import React, { useState } from 'react';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, CssBaseline, Container, Typography } from '@mui/material';
import { Inbox as InboxIcon, Mail as MailIcon } from '@mui/icons-material';

function App() {
  const [open, setOpen] = useState(false);

  const toggleDrawer = () => {
    setOpen(!open);
  };

  return (
    <div>
      <CssBaseline />
      <Drawer  open={open} onClose={toggleDrawer} style={{ width: '100px' }}>
        <div style={{ backgroundColor: '#151515', width: '100px', height: '1024px' }}>
          {/* Sidebar 1 content */}
        </div>
      </Drawer>
      <Drawer anchor="left" open={open} onClose={toggleDrawer} style={{ width: '218px', left: '100px' }}>
        <div style={{ backgroundColor: '#0D0D0F', width: '218px', height: '1024px' }}>
          {/* Sidebar 2 content */}
        </div>
      </Drawer>
      <div style={{ marginLeft: '318px' }}>
        <Container maxWidth="xl" style={{ backgroundColor: '#111115', minHeight: '1024px' }}>
          {/* Main content */}
          <Typography variant="h4" style={{ color: '#ffffff' }}>
            Welcome to My Web Page
          </Typography>
        </Container>
      </div>
    </div>
  );
}

export default App;
